import React from 'react'; 
import './Piece.css';

const typeConv = {
	0: 'pawn', 1:'bishop', 2:'knight', 3:'rook', 4:'queen', 5:'king'
}

const Piece = (props) => {
	let pieceType = this.props.type;
	let pieceColor = this.props.color;
	let pieceClass = `piece ${pieceType} ${pieceColor}`
	return (
		<div className={pieceClass} /> 
	);
}

export default Piece;
